import React from 'react';
import faker from 'faker';


const Card = (props) => {
  return (
		<div className="ui card">
			<div className="image">
				<img alt="abstract" src={props.image} />
			</div>
			<div class="content">
				<div className="header">
					{props.title}
				</div>
			</div>
			<div class="content">
				<div className="description">
					{props.description}
				</div>
			</div>

			<div class="extra content">
					<a>{props.link1}</a>
					<a>{props.link2}</a>
				<div class="ui two buttons">
					<a><div class="ui basic button">{props.link1}</div></a>
					<a><div class="ui basic button">{props.link2}</div></a>					
				</div>
    	</div>

		</div>

  );
};

export default Card;
